#include <iostream>
#include "queue.h"

using namespace std;

char calcolaVincitore(char partecipanti[]);

int main() {
    char partecipanti[] = "";

    char vincitore = calcolaVincitore(partecipanti);

    cout << vincitore << endl;

    return 0;
}

char calcolaVincitore(char partecipanti[]) {
    init(0);

    int len = 0;
    while (partecipanti[len] != '\0') {
        enqueue(partecipanti[len]);
        len++;
    }

    int i = 0;
    char cur, next;
    while (len > 1) {

        first(cur);
        dequeue();
        enqueue(cur);

        int j = 0;
        first(next);
        while (next == cur && j < len) {
            dequeue();
            enqueue(next);
            first(next);
            j++;
        }
        dequeue();
        len--;

        first(next);
        while (j < len) {
            dequeue();
            enqueue(next);
            first(next);
            j++;
        }

        i++;
    }

    first(cur);

    return cur;
}
